import './App.css';
import Menu from './Core/Menu';
import { Contact } from './Pages/Contact/Contact';
import { Discover } from './Pages/Discover/Discover';
import { HousePage } from './Pages/HousePage/HousePage';


function App() {
  return (
    <body>
    <div className="App">
      <Menu/>
      <HousePage></HousePage>
      <Discover/>
      <Contact />
    </div>
    </body>
  );
}

export default App;
